(function($) {
//accordion function
$.fn.accordion = function(param) {
	
 if ( param === undefined ) {
      param = $(".tabs-content > div:has(dl.accordion)"); // DEFAULT: all divs after .tab-content that contains DL tag
  }
  $(".accordion dd").hide(); //Hide all content
  var features = $(param);
  features.css("cursor","pointer");
  features.find(".more").show();
  features.find(".close").hide();
  features.hover(
    function(){
      $(this).find(".more").addClass("hover");
      $(this).find(".close").addClass("hover");
    },
    function(){
      $(this).find(".more").removeClass("hover");
      $(this).find(".close").removeClass("hover");
    }
  );
  
}

$(function(){	
	$('.productfeature .block').each(function(){
		$(this).click(function(){
			$('.accordion dd', this).slideToggle('fast');
			$(".close" , this).toggle();
		    $(".more" , this).toggle();
		})
	});	
	$('.productfeature .icon').click(function(){
			$(this).next('div.block').find('.accordion dd').slideToggle('fast');
			$(this).next('div.block').find('.close').toggle();
			$(this).next('div.block').find('.more').toggle();
		});
})
})(jQuery);

 
