jQuery(document).ready(function($) {
	$('.secondaryNav').each(function(){
        if($('.subColumn', this).size()==0){
            $(this).addClass('hasnosub');
        }
      });
	if($('div#maincontainer').length>0){
		var containerWidth = $('body').width()-$('div#maincontainer').offset().left;
		var t, w, nv;
		$('.menu-section').each(function(){
			 t = $(this);
			 t.css('display','block');
		     w = 0;
		     t.width(4000);
			 $('.menuColumn', $(this)).each(function(){
			    w = w+$(this).width();
			 });
			t.width(w); 
			if((t.parent().offset().left+t.width())>containerWidth){
				nv = (t.parent().offset().left+t.width())-containerWidth;
				$(this).css('left',-nv);
			}	
			t.css('display','');
		});
		$('#navigation #menu>li').css('position', 'relative');
		$('#navigation #menu').css('position', 'relative');
	}
});

