$(document).ready(function(){
    $('#countrySelector .countryList a').each(function(){
            var lngImg = $(this).children('img').attr('src'),
            lngLabel = $(this).children('span').text();
          //click event binding 
          $(this).bind('click', function(){
            var _href = $(this).attr('href');
            if(_href === 'javascript:void(0);'){
                $('#countrySelector').hide();
                $('#globalSiteSelector').hide();
                $('#langSelector').show();
                $('#langSelector .selectedCountry img').attr('src', lngImg);
                $('#langSelector .selectedCountry span').text(lngLabel);
                $('#langSelector .languageSelect').empty();
    
    
                //languages data
                str = JSON.stringify($(this).data('languages'));
                data = $.parseJSON(str);
                // looping the languages and populating to the DOM
                for(var i = 0; i<data.length; i++){
                  $('#langSelector .languageSelect').append("<li><a href=\"javascript:setLocaleCookie('"+data[i].locale+"', '"+data[i].langPath +"');\">"+ data[i].lang +"</a></li>");
                }
            }
            else{
                $('#langSelWrapper').hide();
                $('#shadow').hide();
            }
          });
        });

        /*- Toggle Global Site Selector */
        $('#globalSiteSelectorLink').bind('click', function(){
            $('#countrySelector').hide();
            $('#langSelector').hide();
            $('#globalSiteSelector').show();
        });
        
        /* Close Popup */
        $('.closePopup').bind('click', function(){
            $('.customModal').hide();
            $('#shadow').hide();
        })
        
    

            $('#language-change').bind('click', function(){
            showLangSelector();
        });

        $('#shadow').bind('click',function(){
            hideLangSlector();    })
        $(document).keyup(function(e) {
              if (e.keyCode == 27) {hideLangSlector() }   // esc
        }); 

        
    });
